export const fetchJson = function(response){
  return {
    type: "RECEIVE_FAVORITES",
    response
  }
}
const projectReducer = (state = {}, action) => {
  switch (action.type) {
    case "FETCH_REQUEST":
      return state;
    case "FETCH_SUCCESS": 
      return {...state, posts: action.payload};
    default:
      return state;
  }
} 

export default {
  projectReducer
}
